import gql from "graphql-tag";
import Products from "../components/Products";

const ALL_PRODUCTS_QUERY = gql`
query ALL_PRODUCTS_QUERY{
  allProducts {
  id
  name
  price
  description
  photo {
    id
    image { 
    publicUrlTransformed
    }
  }
  }
}
`
export default function ProductsPage() {
  return (
    <div>
      <Products/>
    </div>
  );
};
